import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {jwtDecode} from 'jwt-decode';
import './DeleteUser.css';
import Cookies from 'js-cookie';

const DeleteUser = () => {
    const [password, setPassword] = useState('');
    const [email, setEmail] = useState('');
    const [passwordTrue, setPasswordTrue] = useState('');
    const [token, setToken] = useState('');
    const [userId, setUserid] = useState('');
    const [numberfiledelete, setNumberfile] = useState(0);

    useEffect(() => {
        const fetchData = async () => {
            const value = Cookies.get('token');
            if (value) {
                const tokenData = JSON.parse(value);
                const decodedToken = jwtDecode(tokenData);
                setEmail(decodedToken.email);
                setPasswordTrue(decodedToken.password);
                setToken(tokenData);
                setUserid(decodedToken.id);
            }
        };
        fetchData();
    }, []);

    const handleDeleteUser = async () => {
        if (password === passwordTrue) {
            try {
                const data = {
                    email: email,
                    password: password
                };
                const response = await axios.post('http://localhost:8000/user/deleteUser', data);
                if (response.status === 200) {
                    alert('User supprimé avec succès');
                    document.cookie = "token=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;";
                    window.location.href = '/';
                }
            } catch (error) {
                console.error('Une erreur s\'est produite lors de la suppression ', error);
            }
        } else {
            alert('Votre mot de passe est incorrect');
        }
    };

    const handleFileUser = async () => {
        if (password === passwordTrue) {
            try {
                const data = {
                    token: token,
                    userid: userId
                };
                const response = await axios.post('http://localhost:8000/file/deleteAllfileUser', data);
                if (response.status === 200) {
                    console.log('Fichiers supprimés');
                }
            } catch (error) {
                console.error('Une erreur s\'est produite lors de la suppression des fichiers ', error);
            }
        } else {
            alert('Votre mot de passe est incorrect');
        }
    };

    const handleCountFileUser = async () => {
        if (password === passwordTrue) {
            try {
                const data = {
                    token: token,
                    userid: userId
                };
                const response = await axios.post('http://localhost:8000/file/filecount', data);
                if (response.status === 200) {
                    setNumberfile(response.data);
                    return response.data;
                }
            } catch (error) {
                console.error('Une erreur s\'est produite lors du comptage des fichiers ', error);
            }
        } else {
            alert('Votre mot de passe est incorrect');
        }
        return 0;
    };

    const handlesendmail = async () => {
        if (password === passwordTrue) {
            try {
                const data = {
                    to: email,
                    text: 'Votre compte ainsi que vos fichiers ont été supprimés',
                };
                const response = await axios.post('http://localhost:8000/user/senmaildelete', data);
                if (response.status === 200) {
                    alert('Email envoyé');
                }
            } catch (error) {
                console.error('Une erreur s\'est produite lors de l\'envoi de l\'email ', error);
            }
        }
    };

    const handlesendmailAdmin = async (numberfile) => {
        if (password === passwordTrue) {
            try {
                const data = {
                    to: 'killianc142@gmail.com',
                    text: `L'utilisateur ${email} a supprimé son compte, ${numberfile} fichiers ont été supprimés`,
                };
                const response = await axios.post('http://localhost:8000/user/senmaildelete', data);
                if (response.status === 200) {
                    alert('Email admin envoyé');
                }
            } catch (error) {
                console.error('Une erreur s\'est produite lors de l\'envoi de l\'email à l\'admin', error);
            }
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        await handleDeleteUser();
        await handleFileUser();
        const numberfile = await handleCountFileUser();
        await handlesendmail();
        await handlesendmailAdmin(numberfile);
    };

    return (
        <>
            <p>Pour supprimer votre compte, veuillez entrer votre mot de passe</p>
            <div className="inscription-container">
                <label className="title">Suppression de compte</label>
                <form onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label className="title2" htmlFor="password">Mot de passe</label>
                        <input
                            type="password"
                            id="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    <button type="submit">Supprimer</button>
                </form>
            </div>
        </>
    );
};

export default DeleteUser;
